import React, {useEffect, useState} from 'react';
import './App.css';
import BasicTextFields from './InputBox'
import ButtonAppBar from "./appbar";
import Box from "@material-ui/core/Box";
import { makeStyles, createStyles } from '@material-ui/core/styles';
import Button from "@material-ui/core/Button";
import RadioButtonsGroup from "./radiobuttons";

const useStyles = makeStyles((theme) => createStyles({
  root: {
    // backgroundColor: "#ff1133",
      border:"2px solid blue",
      backgroundImage:"back.png",
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      marginLeft:"25%",
      marginTop:"5%",
      marginBottom:"5%",
      marginRight:"25%",
      borderRadius:20,
      padding: 40,
  },
}));

function App() {

    const [age, setAge] = useState("");
  const [Total_Bilirubin, setTotal_Bilirubin] = useState("");
  const [Direct_Bilirubin, setDirect_Bilirubin] = useState("");
  const [Alkaline_Phosphotase, setAlkaline_Phosphotase] = useState("");
  const [Alamine_Aminotransferase, setAlamine_Aminotransferase] = useState("");
  const [Aspartate_Aminotransferase, setAspartate_Aminotransferase] = useState("");
  const [Total_Protiens, setTotal_Protiens] = useState("");
  const [Albumin, setAlbumin] = useState("");
  const [Albumin_and_Globulin_Ratio, setAlbumin_and_Globulin_Ratio] = useState("");



     async function getsymtoms(value) {
        console.log(value.target.value);
        setAge(value)

    }


    const classes = useStyles();

    const [data, setData] = useState([]);

    async function getcolnames() {
        const response = await fetch('http://127.0.0.1:8000/symptoms/',
            {

                method: "GET",
                headers: {
                    'Content-Type': 'application/json'
                },
            });
        const json = await response.json();
        setData(json['symptoms']);
        console.log(json['symptoms'])
    }

    useEffect(() => {
        // GET request using fetch inside useEffect React hook
        getcolnames()
    }, []);


    return (
        <div className="App">
            <div>
                <ButtonAppBar/>
            </div>
                <Box display="flex" className={classes.root} flexWrap="wrap">
                    <RadioButtonsGroup/>
                    <BasicTextFields label={data} onChange={(event, value) => getsymtoms(value)}/>
                    <Button variant="contained" color="primary">SUBMIT</Button>
                </Box>

        </div>
    );
}

export default App;
